import React from 'react';

const RenderAboutTile = (props) => {

    return(

        <div className="row">
            <div className="col-12 text-center about-tile">
            <span>{props.icon}</span>
            <span>{props.value}</span>
            <span>{props.text}</span>
            </div>                
        </div>

    );

}

export default RenderAboutTile;
